import { connect } from 'react';
import React, { Component } from 'react'
import { Input, Menu, Segment } from 'semantic-ui-react'

const UserLogin = (props) => {
    let fullName = "";
    let password = "";
    let activeItem = 'bio'
    // checkUser = () => {
    let handleItemClick = (e, { name }) => {console.log(name);  activeItem = name};
    // const { activeItem } = this.state
    return (<>
        <div>
            <Menu attached='top' tabular>
                <Menu.Item
                    name='bio'
                    active={activeItem === 'bio'}
                    onClick={handleItemClick}
                />
                <Menu.Item
                    name='photos'
                    active={activeItem === 'photos'}
                    onClick={handleItemClick}
                />
                <Menu.Menu position='right'>
                    <Menu.Item>
                        <Input
                            transparent
                            icon={{ name: 'search', link: true }}
                            placeholder='Search users...'
                        />
                    </Menu.Item>
                </Menu.Menu>
            </Menu>

            <Segment attached='bottom'>
                <img src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
            </Segment>
            <div><div class="ui top attached tabular menu"><a class="active item">Bio</a>
            <a class="item">Photos</a><div class="right menu"><div class="item">
                <div class="ui transparent icon input"><input type="text" placeholder="Search users..."/>
                <i aria-hidden="true" class="search link icon"></i></div></div></div></div>
                <div class="ui bottom attached segment">
                <img src="https://react.semantic-ui.com/images/wireframe/paragraph.png"/></div></div>
        </div>

    </>
    );
}

